import React from 'react';
import './css/App.css';
import Header from './components/Header';
import Services from './components/Services';
import Footer from './components/Footer';

function App() {
  return (
    <div className="App">
      <Header />
      <Services />
      <Footer />
    </div>
  );
}

export default App;
